import React from "react";
function Header() {
    const options=[
        "A","B","C","D"
    ]
    return (
        <div>
        <form>
            <label>
                Select Plant:
            </label>
            <select>
                { options.map((ele)=>
            <option value={ele}>{ele}</option>
                )}
            </select>
        </form>
        </div>

    );
}
export default Header;
